member.summary:
This class is used to create an instance of the Configuration Service. An instance of the service must be created before any Configuration Server requests can be made. For example:
EventBrokerService brokerService = BrokerServiceFactory.CreateEventBroker(protocol);
IConfService service = ConfServiceFactory.CreateConfService( protocol, brokerService);

 This class holds a reference to the connection to Configuration Server (and the protocol instance).
 Please, use this class to create new instances of configuration objects, subscribe to events, and register for
 notifications.  A simple example below shows how to retrieve information
 about the Environment tenant using this service:


CfgTenantQuery query = new CfgTenantQuery();
query.Dbid = WellKnownDBIDs.EnvironmentDBID;
CfgTenant envTenant = 
     service.RetrieveObject<CfgTenant>(query);

